function App() {
  return (

    <div className="App">
        <div id="loader" className='loader'>
            <img src="" alt="Money Cat logo"/>
            <h1>Money Cat</h1>
        </div>
        <Routes>
            <Route path="/login" element={<Login />}/>
            <Route path="/start" element={<Start />}/>
        </Routes>
    </div>

  );
}

export default App;
